import React from 'react';
import "./_mapSection.scss";

const MapSection = () => {
    return (
        <>
            <div>
                <iframe className="MapSection" src="https://www.google.com/maps/d/embed?mid=14TaonPkOlJyziG2HBBmH6b8uaiaBaro&ehbc=2E312F" width="100%" height="480"></iframe>
            </div>
        </>
    );
};

export default MapSection;
